import React from 'react'
//import './SignUp.css';

const SignUp = () => {
    const imageBackground = process.env.PUBLIC_URL + '/images/thumb-1920-406809.jpg'
    return (
        <div style={{
            backgroundImage: imageBackground,
            height: "600px"
        }}>
            <h1>hello in sign up</h1>
        </div>
    )
}

export default SignUp
